import React from 'react';
import './individualPlayer.css';



function IndividualPlayer() {
  return (
    <div className="individualPlayerArea">

      <div className="playerPictureArea">
        <div className="playerPicture">
          {/* <img src="https://www.fifaultimateteam.it/en/wp-content/uploads/2020/07/lewandowski_fifa-20.jpg"></img> */}
          <p>asd</p>
        </div>
        <div className="playerName">
        </div>
      </div>
      <div className="playerButtons">
          <p>player 1</p>
        <button>Field</button>
        <button>Sub</button>
      </div>

    </div>
  );
}

export default IndividualPlayer;
